import axios from 'axios';

function GetKey() {
  var postData = { email: 'pekyuan@gmail.com', password: 'TmHNf8NLubNvJ36' };
  //debug 2023-07-04 00:07: trial for cors error in the comment line
  //https://stackoverflow.com/questions/45975135/access-control-origin-header-error-using-axios
  let axiosConfig = {
    headers: 
    { 
      'cache-control': 'no-cache, max-age=0',
      'content-type': 'application/json',
      //"Access-Control-Allow-Origin": "*"
      //"Access-Control-Allow-Origin": true 
    }
  };
  axios.post('https://developers.onemap.sg/privateapi/auth/post/getToken', postData, axiosConfig)
    .then((res) => console.log(res.data.access_token));
  return "done";
}

export default GetKey;
